import Search from "./Search";
import userPicture from "../assets/test/alonso.jpeg";

export default function Topbar() {
  return (
    <div className="TopBar">
      <Search />
      <div>
        <img className="SideBarUserPicture" src={userPicture} alt="User" />
        <p>Fernando Alonso</p>
      </div>
    </div>
  );
}
